import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

import axios from 'axios'

const promise = axios.get('http://localhost:3001/notes')

promise.then(response => {
  console.log(response)
})




ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
